                    if (intervalId) {
                        clearInterval(intervalId);
                    }
                })
            })

            function mergeImg(base64Images) {
                var imagePromises = [];
                var pageSize = {
                    width: 1200,
                    height: 1600
                };
                imagePromises.push(new Jimp(pageSize.width, pageSize.height, 0xFFFFFFFF));
                base64Images.forEach((base64Image) => {
                if (base64Image && base64Image.length > 0) {
                    imagePromises.push(Jimp.read(Buffer.from(base64Image.replace(/^data:image\/\w+;base64,/, ''), 'base64')));
                }
                });
                return Promise.all(imagePromises).then((results) => {
                    var resize = {
                    height: Math.ceil(pageSize.height / imagePromises.length),
                    width: Math.ceil(pageSize.width)
                    };
                    var backgroundImage = results[0];
                    var compositeImages = results.slice(1);
                    compositeImages.map(image => image.scaleToFit(resize.width, resize.height));
                    var marginHeight = 25;
                    compositeImages.forEach(image => {
                    backgroundImage.composite(image, (pageSize.width - image.bitmap.width) / 2, marginHeight);
                    marginHeight += resize.height + 25;
                    });
                    return backgroundImage.quality(75).getBase64Async(Jimp.MIME_JPEG);
                });
            }
